function Notify(Title1, Text1, Icon1, Time1)
  game:GetService("StarterGui"):SetCore("SendNotification", {
    Title = Title1,
    Text = Text1,
    Icon = Icon1,
    Duration = Time1,
  })
end
Notify("LSTM Archive", "欢迎使用", "rbxassetid://", 3)
wait(0.2)
print("反机器人")
local vu = game:GetService("VirtualUser")
game:GetService("Players").LocalPlayer.Idled:connect(function()
vu:Button2Down(Vector2.new(0,0),workspace.CurrentCamera.CFrame)
wait(1)
vu:Button2Up(Vector2.new(0,0),workspace.CurrentCamera.CFrame)
end)
Notify("永久免费", "祝你玩的开心","rbxassetid://",3)
wait(1)
game.Players.ChildAdded:Connect(function(player)
    if not pcall (function()
    Notify("玩家加入",""..player.Name.." 加入了这个服务器",tx,5 )
    end) then
      print ("Hello word")
    end
end)
game.Players.ChildRemoved:Connect(function(player)
    if not pcall (function()
    Notify("玩家离开",""..player.Name.." 离开了这个服务器",tx,5 )
    end) then
      print ("Hello word")
    end
end)
wait(1)
local success, library = pcall(function()
    return loadstring(game:HttpGet("https://github.com/AURORA666Script/ui/raw/main/library.z.lua"))()
end)

if not success then
    Notify("LSTM Archive", "UI加载失败", "rbxassetid://", 3)
    return
end

local window = library:new("LSTM Archive Scripts Speed legend")
local LA = window:Tab("主要功能和出生岛刷球体",'16060333448')
local Section = LA:section("功能",true)
Section:Toggle("自动卡宠", "text", false, function(state)
    _G.Evolve = (state and true or false)
	wait()
	while _G.Evolve == true do
		wait()
		game.Replicatedstorage.rEvents.petEvolveEvent:FireServer("evolvePet", "all")
		end
end)

Section:Toggle("自动重生", "Rebirth", false, function(state)
    if state then
           _G.loop = true
           while _G.loop == true do wait()
                 game:GetService("ReplicatedStorage").rEvents.rebirthEvent:FireServer("rebirthRequest")
           end
        else
           _G.loop = false
        end
    end)

Section:Toggle("自动圈", "text", false, function(state)
    _G.Hoops = (state and true or false)
	wait()
	while _G.Hoops == true do
		wait()
    local children = workspace.Hoops:GetChildren()
    for i, child in ipairs(children) do
        if child.Name == "Hoop" then
            child.CFrame = game.Players.LocalPlayer.Character.HumanoidRootPart.CFrame
        end
        end
        end
end)
Section:Toggle("自动圈2", "text", false, function(HoopsV1)
    while wait() do
            if w.flags.HoopsV1 then
                for i,v in pairs(game:GetService("Workspace").Hoops:GetChildren()) do
				firetouchinterest(v, game:GetService('Players').LocalPlayer.Character.HumanoidRootPart, 0)
				wait()
				firetouchinterest(v, game:GetService('Players').LocalPlayer.Character.HumanoidRootPart, 1)
				end
            end
        end
end)
